<script data-legit="mi">
// ONERROR
window.onerror = function onerror() {
  var msg = [];
  for (var i = 0; i < arguments.length; i++) {
    var a = arguments[i];
    if (a && (typeof a === 'object')) {
      if (a.stack) {
        msg.push(a.stack);
      }
      else {
        var msg1 = [];
        for (var k in a) {
          if (typeof a[k] !== 'function' && (a[k] || typeof a[k] !== 'object')) msg1.push(k+':'+a[k]);
        }
        msg.push(msg1.join(', '));
      }
    }
    else {
      msg.push(a===null ? 'null' : a);
    }
  }
  alert(msg.join('\n  '));
}
//# sourceURL=boot/onerror.js
</script>
